    "         seguido de videos y actualizaciones de estado (status).\n",
    "   * Interpretacin:\n",
    "       * Este cluster representa el contenido \"comn\" o de bajo impacto en\n",
    "          la plataforma. Son publicaciones que no logran captar una gran\n",
    "         atencin de la audiencia y, por lo tanto, generan muy poca\n",
    "         interaccin.\n",
