    "       * Altas Reacciones, Baja Discusin: Se caracteriza por tener un\n",
    "         nmero muy alto de num_reactions y num_likes, pero\n",
    "         sorprendentemente pocos comentarios y compartidos.\n",
    "       * Tipo de Contenido: Dominado por videos (video).\n",
    "   * Interpretacin:\n",
    "       * Este cluster agrupa contenido que es muy popular y del agrado de\n",
